import React from 'react';     //type rsf for react simple functional components
import { StyleSheet,View,ScrollView,TouchableOpacity ,Text} from 'react-native';
import Tile from '../components/tile';
import { Card, Title, Paragraph, Button,}  from 'react-native-paper';
import { MaterialCommunityIcons } from '@expo/vector-icons'; 

function RoomContainer(props) {
    return (
       
        <View style = {styles.threetilecontainer}>  
            {/* <Tile  title = "Living Room" name = "sofa"/>
            <Tile  title = "Kitchen" name = "stove"/>            
            <Tile  title = "Bed Room 1" name = "bed-empty"/>
            <Tile  title = "Bed Room 2" name = "bed-empty"/> */}
            <TouchableOpacity
             onPress={() => console.log('Pressed daba')}
             style = {styles.cardStyle}
            >
             <Card style = {styles.cardStyle2}>
             <Card.Content>
             <MaterialCommunityIcons name={props.name} size={64} color="black" />
             <Title>{props.title}</Title>
             <Paragraph>Card content</Paragraph>
          </Card.Content>
    </Card>
           
            </TouchableOpacity>
        </View>
    );
}

const styles = StyleSheet.create({
    threetilecontainer: {
        flexWrap: "wrap",
       flexDirection: 'row'
       
    },
    cardStyle: {
         width: "46%",
         margin: '2%',
        
    },
    cardStyle2: {
        
        // width: "76%",
        backgroundColor:'#91b5ad',
        // margin: '2%',
       
    }

}
)




export default RoomContainer;
